INSERT INTO `site_settings` VALUES (1,'site_name','Serikat Pekerja Kereta Api Indonesia (SP-KAI)','text','2025-12-30 06:27:28','2025-12-30 10:25:32'),(2,'site_tagline','Bangkit Bersatu Maju','text','2025-12-30 06:27:28','2026-01-01 09:23:50'),(3,'hero_title','Serikat Pekerja Kereta Api Indonesia (SP-KAI)','text','2025-12-30 06:27:28','2026-01-01 19:14:35'),(4,'hero_subtitle','Bangkit Bersatu Maju','textarea','2025-12-30 06:27:28','2026-01-01 19:14:35'),(5,'hero_image','/images/hero-bg.jpg','image','2025-12-30 06:27:28','2025-12-30 06:27:28'),(6,'about_title','Tentang Kami','text','2025-12-30 06:27:28','2025-12-30 06:27:28'),(7,'about_content','SP-KAI adalah salah satu serikat pekerja dalam PT Kereta Api Indonesia. SP-KAI bertujuan untuk memperjuangkan hak-hak pekerja PT KAI, mengawal hak-hak kesejahteraan pekerja, dan memastikan tata kelola perusahaan serta membawa perubahan untuk KAI lebih baik.','textarea','2025-12-30 06:27:28','2026-01-01 09:24:02'),(8,'about_image','/uploads/about/1767241031455-248570516.png','image','2025-12-30 06:27:28','2026-01-01 04:17:11'),(9,'footer_address','Gedung Direktorat DC, Kantor Pusat PT Kereta Api Indonesia (Persero) Jl. Perintis Kemerdekaan No. 1 Bandung, Jawa Barat','text','2025-12-30 06:27:28','2026-01-02 12:04:04'),(10,'footer_phone','021-12345678','text','2025-12-30 06:27:28','2025-12-30 06:27:28'),(11,'footer_email','dpppserikatpekerjakai@gmail.com','text','2025-12-30 06:27:28','2026-01-02 12:05:17'),(12,'footer_copyright','© 2026 SP-KAI. All rights reserved.','text','2025-12-30 06:27:28','2026-01-02 00:46:38'),(25,'logo_image','/uploads/gallery/1767241407387-12109993.png','image','2025-12-30 08:51:50','2026-01-01 04:23:27'),(26,'logo_width','120','text','2025-12-30 08:51:50','2026-01-01 04:23:46'),(27,'logo_height','60','text','2025-12-30 08:51:50','2025-12-30 09:39:42'),(28,'vision','Menjadi serikat pekerja yang profesional, kompeten dan terpercaya dalam membangun hubungan industrial guna mewujudkan kesejahteraan pekerja yang adil, proporsional dan bertanggung jawab.\r\n','textarea','2025-12-31 11:08:19','2026-01-01 04:25:09'),(29,'mission','<ul><li>1. Memperjuangkan persamaan hak dan kewajiban sesama pekerja.</li><br/>\r\n<li>2. Menjembatani kepentingan dan aspirasi pekerja dengan perusahaan.</li><br/>\r\n<li>3. Menciptakan suasana kerja yang kondusif dan menumbuhkan rasa solidaritas antar pekerja.</li><br/>\r\n<li>4. Menjadikan serikat pekerja yang transparan, amanah dan profesional.</li><br/>\r\n<li>5. Mensukseskan program-program perusahaan dan organisasi.</li></ul>\r\n','textarea','2025-12-31 11:08:19','2026-01-01 09:23:45'),(30,'feature_1_title','Perjuangan Hak Pekerja','text','2025-12-31 11:08:19','2025-12-31 11:08:19'),(31,'feature_1_description','Kami berjuang untuk melindungi hak-hak pekerja dan memastikan keadilan di tempat kerja','textarea','2025-12-31 11:08:19','2025-12-31 11:08:19'),(32,'feature_2_title','Perlindungan Hukum','text','2025-12-31 11:08:19','2025-12-31 11:08:19'),(33,'feature_2_description','Memberikan dukungan dan konsultasi hukum untuk anggota yang membutuhkan bantuan','textarea','2025-12-31 11:08:19','2025-12-31 11:08:19'),(34,'feature_3_title','Solidaritas Berserikat','text','2025-12-31 11:08:19','2025-12-31 11:08:19'),(35,'feature_3_description','Membangun komunitas yang solid dan saling mendukung untuk kesuksesan bersama','textarea','2025-12-31 11:08:19','2025-12-31 11:08:19'),(42,'chairman_name','AD. BUDI SANTOSA, SH., SE., MT.','text','2026-01-01 22:55:06','2026-01-01 23:47:36'),(43,'chairman_title','Ketua Umum Serikat Pegawai Kereta Api Indonesia (2022-2025)','text','2026-01-01 22:55:06','2026-01-01 23:44:21'),(44,'chairman_photo','/uploads/about/1767314699149-694575717.png','text','2026-01-01 22:55:06','2026-01-02 00:44:59'),(45,'chairman_welcome','Assalamualaikum warahmatullahi wabarakatuh<br> \r\n\r\n<strong>SP-KAI…..Bangkit Bersatu Maju</strong><br> \r\n\r\n<p>Rekan-rekan semua anggota SP-KAI yang kami banggakan, sebelumnya marilah kita mengucapkan syukur kepada Allah SWT, karena atas karunianya SP-KAI yang kita cintai makin maju dan makin dibanggakan dapat mempersembahkan Website Serikat Pekerja Kereta Api Indonesia (SP-KAI).</p><br> \r\n\r\n<p>Website SP-KAI adalah salah satu sarana penyampaian informasi apapun terkait kegiatan SP-KAI, dan juga sebagai media untuk malakukan diskusi, pengaduan/ permohonan advokasi serta mendapatkan informasi perturan ketenagakerjaan dan atau informasi lainnya terkait hubungan kerja antara SP-KAI dengan PT Kereta Api Indonesia (Persero).</p><br> \r\n\r\n<p>Meski baru berusia 2 tahun, SP-KAI dituntut untuk menghadapi perkembangan zaman yang semakin maju diera digital saat ini, maka Website SP-KAI dibuat untuk menyokong kegiatan SP-KAI yang transparansi, sosialisasi (informasi), dokumentasi, pengembangan organisasi dan juga sebagai wadah penyampaian aspirasi anggota. Website SP-KAI harus mampu menjadi penyemangat dan sumber inspirasi setiap anggota SP-KAI dalam kiprahnya sebagai anggota serikat pekerja, sehingga bermunculan anggota-anggota bermental pejuang, dan mencintai organisasinya. Selama kurun waktu dua tahun ini perkembangan jumlah anggota selalu meningkat. Dengan prinsip selembar demi selembar sudah bisa membuat pihak lain gemetar. Kita tidak gentar dengan koar-koar pihak lain untuk memancing onar. Kita tetap focus pada tujuan, ingat kalimat bijak “Anjing menggonggong kafilah berlalu”. Ingatlah selalu pada saat awal berdirinya SP-KAI ada pihak yang mengatakan kalau SP-KAI tidak akan diakui manajemen. Seiring waktu berlalu pihak yang sama mengatakan kalau SP-KAI bentukan/underbow manajemen, dan pihak yang sama juga saat ini mengatakan kalau SP-KAI musuh manajemen, entah besok pada kesempatan yang lain pihak yang sama dimaksud akan mengatakan apalagi.</p> <br> \r\n\r\n<p>Oleh karena itu kepada para anggota SP-KAI untuk tidak terpancing framing-framing yang diciptakan pihak lain yang patut diduga untuk melemahkan mental dan semangat anggota SP-KAI. Fondasi (kekuatan) serikat pekera adalah anggota, dengan sifat sukarela (menjadi anggota) pekerja akan mendukung kuat setiap gerak dan aktifitas serikat pekerjanya. Disetiap lingkup sosial, serikat pekerja harus memiliki kekuatan untuk perlindungan anggota dari ketidakadilan dan penyalahgunaan kekuasan. Kekuatan yang harus selalu dimiliki oleh anggota dan pengurus serikat pekerja adalah semangat (spirit) dan pengetahuan (knowledge) serta mempunyai komitmen yang kuat dalam perjuangan.</p><br> \r\n\r\n<p>Rekan-rekan semua anggota SP-KAI yang kami cintai. Perjuangan kita masih panjang. Mari tetap kita jaga kekompakan dan kebersamaan. Kita berjuang bersama, karena dukungan anggota merupakan aset terbesar SP-KAI. Kita masih perlu berjuang untuk persamaan hak sesama pekerja di perusahaan dan equaltreatment pekerja serta perlakuan yang standar, adil dan tidak tebang pilih. Ikhlaslah dalam berjuang! Jangan memanfaatkan serikat untuk hidup tapi hidupilah serikat. Jangan menjadikan ambisi dan aspirasi pribadi dengan mengatasnamakan organisasi. Tetap fokus pada tujuan. Bersama-sama untuk kepentingan Bersama. Hindari pencitraan disana-sini! Pada akhirnya nanti pekerja akan mengetahui bahwa siapa sebenarnya yang berjuang, siapa yang sebenarnya pura-pura berjuang dan siapa sebenarnya yang ingin dianggap berjuang.</p><br> \r\n\r\n<p>Akhir kata, mari kita besarkan SP-KAI, mari kita besarkan kereta api. Tingkatkan profesionalisme, jaga integritas, semangat dalam bekerja. Karena pada dasarnya jika kita bekerja dengan profesional maka produktifitas yang diperoleh akan meningkat. Dengan produktivitas yang meningkat maka akan menghasilkan pendapatan yang tinggi. Pendapatan yang tinggi akan berdampak pada keuntungan yang tinggi pula. Keuntungan tersebut akhirnya kembali lagi ke kita semua pekerja kereta api. SP-KAI hadir untuk perubahan KAI yang lebih baik.</p><br> \r\n\r\nSalam Bangkit Bersatu Maju !\r\n','text','2026-01-01 22:55:06','2026-01-02 00:03:29');
